# -*- coding: utf-8 -*-

class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        substring = []
        rv = 0
        for c in s:
            if c not in substring:
                substring.append(c)
            else:
            # If the character is already in the substring, get it's index and reset the substring to start from index+1
                substring = substring[substring.index(c)+1:]
                substring.append(c)
            # Record the length of current substring if it's the longest
            if len(substring) > rv:
                rv = len(substring)
        return rv
                        

